import React, { Component, Fragment } from 'react';

class Home extends Component {

    constructor(props){
        super(props);

        this.state = {
            search_input: '',
            list: {p1:'one',p2:'tow'}
        }
    }

    render() {
        return (
            <Fragment>
                <div>
                    <ul>
                        <li></li>
                        <li></li>
                        <li></li>
                    </ul>
                </div>
            </Fragment>
        )
    }

}

export default Home;
